    true,nt"url": null,nt"notes": "<p>2011-2014. Centers for Disease Control
    and Prevention (CDC). State Tobacco Activities Tracking and Evaluation (STATE) System.
     BRFSS Survey Data.  The BRFSS is a continuous, state-based surveillance system
    that collects information about modifiable risk factors for chronic diseases and
    other leading causes of death. The data for the STATE System were extracted from
    the annual BRFSS surveys from participating states.  Tobacco topics included are
    cigarette smoking status, cigarette smoking prevalence by demographics, cigarette
    smoking frequency, and quit attempts. NOTE: these data are not to be compared with
    BRFSS data collected 2010 and prior, as the methodologies were changed. Please refer
    to the FAQs / Methodology sections for more details.</p>n",nt"license_title":
